import React from 'react';

import classes from './Feira.module.css';

const feira = ( props ) => {
    return (
        <tr>
        <td className={classes.Feira}>
            <p>Nome: {props.nome}</p>
            <p>descr: {props.descr}</p>
        </td>
        </tr>
    );
};

export default feira;
